import React from 'react'

const Todos = (props) => {
    const count = props.list.length
    const displayList = props.list.map(x=>{
        return(
            <li className="collection-item">{x.todo}</li>
        )
    })

    return (
        <div>
<p>You have {}</p>
            <ul className="collection">
                {displayList}
            </ul>

        </div>
    )
}

export default Todos
